    false,nt"url": null,nt"notes": "This annual narrative report for the McGregor
    District of the Upper Mississippi River National Wildlife and Fish Refuge summarizes
    Refuge activities during the 1998 fiscal year.  The report begins with an introduction
    to the Refuge and a summary of the yearu2019s highlights and climatic conditions.
     Information about monitoring and studies- including surveys and censuses- is provided
    next.  Habitat restoration and management projects are also covered; activities
    include wetland restoration, riverine restoration, water level management, moist
    soil management, farming, timber management, fire management, and vegetation control.
     Fish and wildlife management is discussed next with emphasis on bird banding and
    pest control.  Coordination activities, such as interagency coordination and private
    land activities, are outlined.  The resource protection section provides information
    about law enforcement, permits, cultural resource management, and land acquisition
    support.  Information about public education and recreation is given including visitor
    services, outreach, and trapping. Refuge planning and administration- including
    general administration, safety, maintenance, and volunteers- are discussed; The
    wildlife section is discusses endangered species, threatened species, waterfowl,
    marsh birds, shorebirds, raptors, fisheries resources, and wildlife diversity.  Finally,
    items of interest are provided.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
